import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { HttpClient, HttpClientModule } from '@angular/common/http';
import { FormsModule } from '@angular/forms';

const API_URL = (import.meta as any).env?.VITE_API_URL || (window as any).API_URL || 'http://localhost:8000/api';

interface Score {
  id: number;
  user_name: string;
  score: number;
}

@Component({
  selector: 'app-puntaje',
  standalone: true,
  imports: [CommonModule, HttpClientModule, FormsModule],
  templateUrl: './puntaje.component.html',
  styleUrls: ['./puntaje.component.scss']
})
export class PuntajeComponent {
  scores: Score[] = [];
  filteredScores: Score[] = [];
  search: string = '';
  loading = true;

  constructor(private http: HttpClient) {
    this.fetchScores();
  }

  fetchScores() {
    this.loading = true;
    this.http.get<Score[]>(`http://localhost:8000/scoreboard`).subscribe(scores => {
      this.scores = scores;
      this.filteredScores = scores;
      this.loading = false;
    });
  }

  onSearch() {
    const term = this.search.trim().toLowerCase();
    if (!term) {
      this.filteredScores = this.scores;
    } else {
      this.filteredScores = this.scores.filter(s => s.user_name?.toLowerCase().includes(term));
    }
  }
}
